out vec4 fragColor;

uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

uniform float u_speed;
uniform float u_camera_dist;
uniform float u_morph;
uniform float u_fov;

// Constants
#define MAX_STEPS 128
#define SURF_DIST 0.001
#define MAX_DIST 50.0

// Rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Smooth Minimum for organic blending
float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// 3D Noise for "dreamy" textures
float noise(vec3 p) {
    return fract(sin(dot(p, vec3(12.9898, 78.233, 45.164))) * 43758.5453);
}

// The "Melting Clock" or "Soft Object" logic
float sdSoftBox(vec3 p, vec3 b, float r) {
    // Distort Y based on X/Z to create a "draping" effect
    float drape = sin(p.x * 2.0 + iTime * u_speed) * 0.2 * u_morph;
    p.y += drape;
    // Stretch downward (melting)
    if(p.y < 0.0) p.x *= (1.0 - p.y * 0.5 * u_morph);

    vec3 q = abs(p) - b;
    return length(max(q, 0.0)) + min(max(q.x, max(q.y, q.z)), 0.0) - r;
}

// The Surreal Landscape
float map(vec3 p) {
    float t = iTime * u_speed;

    // The Infinite Desert Floor
    float floorDist = p.y + 2.0 + sin(p.x * 0.5) * cos(p.z * 0.5) * 0.2;

    // Melting Obelisk / Structure
    vec3 p1 = p;
    p1.xy -= vec2(0.0, 1.0);
    p1.xz *= rot(t * 0.2);
    float obelisk = sdSoftBox(p1, vec3(0.5, 2.5, 0.5), 0.1);

    // Floating "Eyes" or Spheres
    vec3 p2 = p;
    p2.y -= 3.0 + sin(t + p.x * 0.5) * 1.5;
    p2.x = mod(p2.x + 10.0, 20.0) - 10.0;
    float spheres = length(p2) - 0.8;

    // The "Thin Leg" (Crutch-like structure)
    vec3 p3 = p;
    p3.x -= 4.0;
    float legs = length(p3.xz) - 0.05 * (p3.y + 3.0);
    legs = max(legs, -p3.y - 2.0); // Cut bottom
    legs = max(legs, p3.y - 4.0);  // Cut top

    float scene = smin(obelisk, floorDist, 1.5);
    scene = smin(scene, spheres, 1.0);
    scene = min(scene, legs);

    return scene;
}

// Normal calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.001, 0.0);
    vec3 n = map(p) - vec3(
        map(p - e.xyy),
        map(p - e.yxy),
        map(p - e.yyx)
    );
    return normalize(n);
}

// Simple Shadow
float getShadow(vec3 ro, vec3 rd) {
    float res = 1.0;
    float t = 0.01;
    for(int i = 0; i < 16; i++) {
        float h = map(ro + rd * t);
        res = min(res, 8.0 * h / t);
        t += clamp(h, 0.02, 0.1);
        if(res < 0.01 || t > 10.0) break;
    }
    return clamp(res, 0.0, 1.0);
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 m = iMouse.xy / iResolution.xy;

    float t = iTime * u_speed;

    // Path for the camera
    vec3 ro = vec3(0.0, 1.0, -u_camera_dist);
    // Add some "unstable" dream movement
    ro.x += sin(t * 0.3) * 3.0;
    ro.y += cos(t * 0.2) * 1.0;

    vec3 ta = vec3(0.0, 0.0, 0.0); // Look at center

    // Camera setup
    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0.0, 1.0, 0.0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f * u_fov + uv.x * r + uv.y * u);

    // Raymarching
    float d = 0.0;
    float t_dist = 0.0;
    for(int i = 0; i < MAX_STEPS; i++) {
        vec3 p = ro + rd * t_dist;
        d = map(p);
        if(abs(d) < SURF_DIST || t_dist > MAX_DIST) break;
        t_dist += d;
    }

    // Shading
    vec3 col = vec3(0.0);

    // Sky gradient (Catalan sky tones: amber to deep teal)
    vec3 sky = mix(vec4(0.9, 0.7, 0.4, 1.0), vec4(0.1, 0.3, 0.5, 1.0), rd.y + 0.5).rgb;
    col = sky;

    if(t_dist < MAX_DIST) {
        vec3 p = ro + rd * t_dist;
        vec3 n = getNormal(p);
        vec3 lightPos = vec3(10.0, 20.0, -10.0);
        vec3 l = normalize(lightPos - p);

        float diff = clamp(dot(n, l), 0.0, 1.0);
        float shad = getShadow(p + n * 0.02, l);

        // Material colors: Desert gold and sickly pale skin tones
        vec3 matCol = vec3(0.8, 0.7, 0.5); 
        if(p.y > 0.5) matCol = vec3(0.9, 0.85, 0.8); // Pale flesh

        // Apply "texture"
        matCol *= 0.9 + 0.1 * sin(p.x * 10.0) * cos(p.z * 10.0);

        col = matCol * (diff * shad + 0.2); // Diffuse + Ambient

        // Specular for a "wet" or "wax" look
        vec3 ref = reflect(rd, n);
        float spec = pow(clamp(dot(ref, l), 0.0, 1.0), 16.0);
        col += spec * 0.3 * shad;

        // Atmospheric haze
        col = mix(col, sky, smoothstep(0.0, MAX_DIST, t_dist));
    }

    // Post Processing
    // Vignetting
    col *= 1.0 - length(uv) * 0.5;
    // Warm tone grading
    col = pow(col, vec3(0.8, 0.9, 1.0));
    // Grain
    col += (noise(vec3(uv * 100.0, iTime)) - 0.5) * 0.05;

    fragColor = vec4(col, 1.0);
}
